import React, { useState } from 'react';
import { BarChart, Bar, PieChart, Pie, Cell, ResponsiveContainer, Tooltip, LineChart, Line, XAxis, YAxis, CartesianGrid } from 'recharts';
import { CheckCircle, XCircle, Clock, PlayCircle, Upload, TrendingUp, Activity } from 'lucide-react';
import Papa from 'papaparse';
import './App.css'; // Added CSS import

const Dashboard = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setLoading(true);
    setError(null);

    Papa.parse(file, {
      header: true,
      dynamicTyping: true,
      skipEmptyLines: true,
      complete: (results) => {
        if (results.data && results.data.length > 0) {
          const row = results.data[0];
          setData({
            totalCases: row['Total Test Cases'] || 0,
            totalExecuted: row['Total Executed'] || 0,
            totalPassed: row['Total Passed'] || 0,
            totalFailed: row['Total Failed'] || 0,
            inProgress: row['Total In Progress'] || 0,
            executionRate: parseFloat(row['% Execution']) || 0,
            passRate: parseFloat(row['% Passed']) || 0
          });
        }
        setLoading(false);
      },
      error: (err) => {
        setError('Failed to parse CSV file. Please check the file format.');
        setLoading(false);
      }
    });
  };

  if (loading) {
    return (
      <div className="dashboard">
        <div className="loading">
          <Activity size={48} />
          <p>Loading dashboard...</p>
        </div>
      </div>
    );
  }

  // Metric Card Component
  const MetricCard = ({ title, value, subtitle, icon: Icon, iconColor }) => (
    <div className="metric-card">
      <div className="metric-header">
        <span className="metric-title">{title}</span>
        <div className={`metric-icon ${iconColor}`}>
          <Icon size={24} color="white" />
        </div>
      </div>
      <div className="metric-value">{value}</div>
      {subtitle && <div className="metric-subtitle">{subtitle}</div>}
    </div>
  );

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <div className="dashboard-icon">
          <Activity size={48} color="white" />
        </div>
        <h1 className="dashboard-title">Test Execution Dashboard</h1>
        <p className="dashboard-subtitle">Real-time Testing Metrics & Analytics</p>

        <div className="upload-section">
          <label className="upload-button">
            <Upload size={20} />
            Upload Different File
            <input 
              type="file" 
              accept=".csv" 
              onChange={handleFileUpload}
              style={{ display: 'none' }}
            />
          </label>
          {!data && (
            <p style={{ color: 'rgba(255,255,255,0.8)', marginTop: '10px' }}>
              Select your dashboard.csv file to visualize test execution metrics
            </p>
          )}
        </div>
      </div>

      {error && (
        <div className="error">
          <XCircle size={24} />
          <p>{error}</p>
        </div>
      )}

      {data && (
        <>
          <div className="metrics-grid">
            <MetricCard
              title="TOTAL TEST CASES"
              value={data.totalCases}
              icon={PlayCircle}
              iconColor="icon-purple"
            />

            <MetricCard
              title="TOTAL EXECUTED"
              value={data.totalExecuted}
              subtitle={`${data.executionRate.toFixed(2)}% Execution Rate`}
              icon={TrendingUp}
              iconColor="icon-blue"
            />

            <MetricCard
              title="TOTAL PASSED"
              value={data.totalPassed}
              subtitle={`${data.passRate.toFixed(2)}% Pass Rate`}
              icon={CheckCircle}
              iconColor="icon-green"
            />

            <MetricCard
              title="TOTAL FAILED"
              value={data.totalFailed}
              subtitle={`${((data.totalFailed / data.totalExecuted) * 100 || 0).toFixed(2)}% Failure Rate`}
              icon={XCircle}
              iconColor="icon-red"
            />

            <MetricCard
              title="TOTAL IN PROGRESS"
              value={data.inProgress}
              icon={Clock}
              iconColor="icon-orange"
            />
          </div>

          <div className="charts-section">
            <div className="chart-card">
              <h3 className="chart-title">Execution Summary</h3>
              <ResponsiveContainer width="100%" height={300}>
                <PieChart>
                  <Pie
                    data={[
                      { name: 'Passed', value: data.totalPassed, color: '#10B981' },
                      { name: 'Failed', value: data.totalFailed, color: '#EF4444' },
                      { name: 'In Progress', value: data.inProgress, color: '#F59E0B' },
                      { name: 'Not Executed', value: data.totalCases - data.totalExecuted, color: '#6B7280' }
                    ]}
                    cx="50%"
                    cy="50%"
                    innerRadius={60}
                    outerRadius={100}
                    dataKey="value"
                  >
                    {[
                      { name: 'Passed', value: data.totalPassed, color: '#10B981' },
                      { name: 'Failed', value: data.totalFailed, color: '#EF4444' },
                      { name: 'In Progress', value: data.inProgress, color: '#F59E0B' },
                      { name: 'Not Executed', value: data.totalCases - data.totalExecuted, color: '#6B7280' }
                    ].map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={entry.color} />
                    ))}
                  </Pie>
                  <Tooltip 
                    contentStyle={{
                      backgroundColor: 'rgba(0, 0, 0, 0.8)',
                      border: 'none',
                      borderRadius: '8px',
                      color: 'white'
                    }}
                  />
                </PieChart>
              </ResponsiveContainer>
            </div>

            <div className="chart-card">
              <h3 className="chart-title">Test Results Breakdown</h3>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart
                  data={[
                    { name: 'Passed', value: data.totalPassed, color: '#10B981' },
                    { name: 'Failed', value: data.totalFailed, color: '#EF4444' },
                    { name: 'In Progress', value: data.inProgress, color: '#F59E0B' },
                    { name: 'Not Executed', value: data.totalCases - data.totalExecuted, color: '#6B7280' }
                  ]}
                  margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
                >
                  <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
                  <XAxis 
                    dataKey="name" 
                    stroke="rgba(255,255,255,0.8)"
                    fontSize={12}
                  />
                  <YAxis 
                    stroke="rgba(255,255,255,0.8)"
                    fontSize={12}
                  />
                  <Tooltip 
                    contentStyle={{
                      backgroundColor: 'rgba(0, 0, 0, 0.8)',
                      border: 'none',
